import React from 'react';

const ExpansionAreas = () => {
  return (
    <div style={{padding: '4rem 2rem', textAlign: 'center'}}>
      <h1>Expansion Areas</h1>
      <p>Market analysis and expansion opportunities coming soon...</p>
      <div style={{marginTop: '2rem'}}>
        <p>Target locations: Lonavala, Kamshet, Karjat, Pawna Lake</p>
      </div>
    </div>
  );
};

export default ExpansionAreas;
